import 'bootstrap/dist/css/bootstrap.min.css';
//import './App.css';

import Layout from '../../components/Layout/Layout';


class App extends Component {
	render() {
		return (
			<Layout>
				<h1>Rick & Morty</h1>
				<p>hey</p>
			</Layout>
		);
	}
}

export default App;
